import React from "react";
import carServices from "../services/carServices";
import {useEffect, useState} from 'react';
import { useParams } from "react-router-dom";
import {Link} from 'react-router-dom';

const Brand = () => {
    const {car_brand} = useParams();
    const[car, setCar] = useState(null);
    useEffect(() => {
        fetch(`http://localhost:8080/car/${car_brand}`)
        .then(res => res.json())
        .then(data => setCar(data))
    }, [car_brand]);

    return (
        <div>
            <h1>AutoShow.by</h1>
            <hr></hr>
            
            <div class="cars">
            {
                        this.state.cars.map(
                            car =>
                            <div class="car" key = {car.id}>
                                <div class="car-img">
                                    <p><img src ={car.imageCar}></img></p>
                                </div>
                                <div class="car-info-all">
                                    <div class="car-info">
                                        <h4><Link to={`/car/${car.id}`}> {car.carBrand} {car.model}</Link></h4>
                                        <p>Год выпуска: {car.yearRelease}</p>
                                    </div>
                                    <div class="prise-car">
                                        <h4>{car.prise}$</h4>
                                    </div>
                                </div>
                            </div>
                        )
                    }
            </div>
        </div>
        
    )
}
export default Brand;
